GReddy BL コンフォートダウンスプリングは、ローダウンスプリングに求められる3大要素「乗り心地」「ベストフォルム」「耐へたり性」をクリアした全車種車検対応品です。 <br>400種類を超える車種ラインナップのそれぞれを最適なダウン量になるように専用設計。乗り心地を犠牲にすることなく程よいローダウンでスタイリッシュなフォルムを演出します。<br> ■ダウン値： 45～50ｍｍ ■バネレート： F：2.4ｋｇ R：2.3ｋｇ ※ご注文後のキャンセル及び返品は、欠品中の場合や初期不良を除いて一切お受けできませんので予めご了承下さい。 <br>対応車種： W10 アベニール (SR18DE  H2/5-10/8） ※45-50 <br>　車検対応品<br>足回り/スプリング<tr><td colspan="2">
<center><img src="https://image.rakuten.co.jp/parts/cabinet/design/2017summertire2.jpg" border="0" width="800px"><br>
</td></tr></center>


