ローダウンと快適性能を両立。「ローダウン＝硬い」という方程式を見事に覆し、乗り心地を損なうことなくスタイリッシュなローダウンを可能にした柔軟設計、それがサステックNF210。30～40mmものローダウンを実現しているにもかかわらず、バネレート10％未満という数値は純正とほぼ同等の乗り心地を再現してくれます。また、柔らかいバンプラバーを装着することでその性能はさらにアップ。快適でスムーズなドライブフィーリングを大切にしたい方にお奨めのサスペンションです。<br><br>●ダウン量 (mm)：フロント 15～25 / リア 5～15 ●エンジン型式：JB-DET ●前後1台分 ●使用期間3年間・走行距離5万kmのヘタリ保証<br><br>【納期】お取り寄せ商品のため、お急ぎの場合はご注文前に必ず納期確認を頂きますようお願い申し上げます。<br><br>対応車種：98/10～02/10 L902S ムーヴ<br><br>車検対応品<br><br>足回り | スプリング<tr><td colspan="2">
