究極の合法ローダウン。見た目の美しさを極限まで追求したドレスアップフォルムDF210。 基準ダウン量を50～60mmとし、最低地上高90mmの限界ギリギリまで車高を落とし込んだビジュアル仕様。バネレート10～15％アップさせつつ、専用バンプストッパーと絶妙なコイリング設計により、従来品に比べ乗り心地アップも実現しています。 <br><br>●ダウン量 (mm)：フロント 40～50 / リア 35～45 ●エンジン型式：1ZZ-FE ●前後1台分 ●使用期間3年間・走行距離5万kmのヘタリ保証<br><br>【納期】お取り寄せ商品のため、お急ぎの場合はご注文前に必ず納期確認を頂きますようお願い申し上げます。<br><br>対応車種：01/4～04/4 ZZE127 WILL-VS<br><br>車検対応品<br><br>足回り | スプリング<tr><td colspan="2">
