手軽にリフトアップ！【車検対応アップサス】錆に強いパーカー処理！「リン酸鉄被膜処理」<br><br>雪、雨、潮風、凍結防止剤などによるスプリングの錆を極力防ぐため、アップサスにはパーカー処理いわゆる「リン酸鉄被膜処理」加工後に紛体塗装する事で耐久性が向上！<br><br>●ノーマルショック対応　●25mm～35mm リフトアップ　●パーカー処理済み　●車検対応　１台分<br><br>適合車種：ME31S ハスラー/MS31S フレア クロスオーバー 4WD車<br><br><br><br>足回り | スプリング<BR>※こちらの商品は代引き不可です<tr><td colspan="2">
